import 'animate.css'
import React from "react";
import loadingPic from './bg.png'
const LandingPage = () => {
  return (
   <div className=' w-full h-full'>
    <img src={loadingPic} alt='Logo'  />
   </div>
  );
};



export default LandingPage;
